function Heading(){

    let date = newDate(2020,8,24,13);
    date=date.getHours();
     const greet="";
    if(date>=1 && date<12){
     greet ="good morning";
    }else if(date >= 12 && date < 7){
        greet="good evening";
    }else{
        greet="good night";
    }
     
    return 
       
       <h1>hey sir {greet}</h1>;
       
       }

export default Heading;
